function minZeroArray(nums: number[], queries: number[][]): number {
  const n = nums.length;

  if (nums.every(num => num === 0)) {
      return 0;
  }
  let left = 0;
  let right = queries.length;
  const canMakeZero = (k: number): boolean => {
      const diff = new Array(n + 1).fill(0);
      for (let i = 0; i < k; i++) {
          const [l, r, val] = queries[i];
          diff[l] -= val;
          if (r + 1 < n) {
              diff[r + 1] += val;
          }
      }
      let currentDecrement = 0;
      for (let j = 0; j < n; j++) {
          currentDecrement += diff[j];
          if (nums[j] + currentDecrement > 0) {
              return false;
          }
      }
      return true;
  };
  while (left < right) {
      const mid = Math.floor((left + right) / 2);
      if (canMakeZero(mid + 1)) {
          right = mid;
      } else {
          left = mid + 1;
      }
  }
  return left < queries.length ? left + 1 : -1;
}

